import Form from 'react-bootstrap/Form'
import React from 'react'

const importFile = () => {
  return (
    <div>
      <Form.Group controlId='formFile' className='mb-3'>
        <Form.Label>Import Econsult File</Form.Label>
        <Form.Control type='file' />
      </Form.Group>
    </div>
  )
}

export default importFile
